import React from "react";
import "./UserCardList.css";

const UserCardList = (props) => {
  const { name, username, email, address, phone, website, company } =
    props.value;

  return (
    <>
      <a href="">
        <div class="card">
          <header class="card-personal-header">
            <h1 class="card-personal-name">{name}</h1>
            <a href="/" class="card-personal-link">
              {username}
            </a>
            <p class="card-personal-description">{phone}</p>
          </header>
        </div>
      </a>
    </>
  );
};
export default UserCardList;
